    false,nt"url": null,nt"notes": "The NOAA Coastal Mapping Shoreline Products
    from the Remote Sensing Division are primarily for application to the nautical charts
    produced by NOAA's Office of Coast Survey. NOAA Coastal Mapping Shoreline Products
    includes National Shoreline, Continually Updated Shoreline Product, and Raster T-
    and TP-Series Maps (T-Sheets). The National Geodetic Survey's coastal mapping shoreline
    products geospatially depict the coastal realm of the United States and its territories
    including the Great Lakes and their connecting navigable waterways.",nt"license_title":
